import React from 'react';

const Liked = ({ artwork }) => {
  return (
    <div className="like-container" aria-label="Liked artwork">
      <i className="fas fa-heart" style={{ color: 'pink' }} aria-label="Liked icon"></i>
      <p className="like-text" aria-label="Liked text">You liked this artwork: {artwork}</p>
    </div>
  );
};

export default Like;
